import React from "react";
import { BrowserRouter as Router ,Route, Routes } from "react-router-dom";
import Home from './page/home'
export default function MainRoutes(){
    return(
        <Router>
            <Routes>
                <Route
                    path="/" element={<Home/>}
                />
                <Route
                    path=""
                />
            </Routes>
        </Router>
    )
}
